import React from "react";
import "../styles/Navbar.scss";
import logo from "../assets/logo.png";
import myAvatar from "../assets/profil.png"; 

const Navbar = ({ onNavigate }) => {
  return (
    <nav className="navbar">
      {/* St√¢nga: Logo + Search */}
      <div className="navbar-left">
        <img src={logo} alt="Logo" className="navbar-logo" />
        <input
          type="text"
          className="navbar-search"
          placeholder="Search on SayHi..."
        />
      </div>

      {/* Mijloc*/}
      <div className="navbar-center">
        <button onClick={() => onNavigate("home")}>üè†</button>
        <button onClick={() => onNavigate("profile")}>üë§</button>
        <button onClick={() => alert("üòÑ")}>‚ú®</button>
      </div>

      {/* Dreapta: Profil */}
      <div className="navbar-right">
        <button title="Message">üí¨</button>
        <button title="Notifications">üîî</button>
        <img
          src={myAvatar}
          alt="Profil"
          className="navbar-avatar"
          onClick={() => onNavigate("profile")}
        />
      </div>
    </nav>
  );
};

export default Navbar;
